(923, 217, 'header_header_teaser', 'Der er mange ting at huske pÃ¥, fÃ¸rste gang man flytter hjemmefra. Typisk starter man fra scratch og skal ud og erhverve alt hvad der hÃ¸rer til, nÃ¥r man skal starte et nyt hjem.\r\n\r\nDerfor har vi lavet flytte hjemmefra listen. Listen beskriver de mest basale ting der er gode at have med nÃ¥r man flytter hjemmefra. Her er en liste over nyttige ting der er gode at tÃ¦nke over, nÃ¥r man flytter hjemmefra for fÃ¸rste gang. Listen er delt op i kategorier, sÃ¥ det er nemmere at finde rundt i. Egner sig specielt til unge og studerende der lige er flyttet hjemmefra, men kan ogsÃ¥ bruges som inspiration af alle andre.\r\n\r\nListen er ikke udtÃ¸mmende og der kan sagtens vÃ¦re ting vi har glemt. Du er derfor meget velkommen til at skrive en kommentar til artiklen, hvis du har nogle gode forslag til hvad der mangler. Det skal dog siges at listen er ment til kun at skulle dÃ¦kke det mest basale og nÃ¸dvendigvis ikke et komplet hjem.\r\n\r\nMange af tingene kan man kÃ¸be billigt i Ikea eller diverse isenkrÃ¦mmere.'),
