(2266, 236, 'first_section_section_content', 'Der bliver gjort klar, og malingen rÃ¸res, sÃ¥ den er klar til brug. Lucas er den fÃ¸rste der dypper penslen, da han slet ikke kan vente. Familien er mestre i at gÃ¸re det sure til det sÃ¸de, og malerarbejdet et ikke en undtagelse. Her hygger familien omkring det, og det giver masser af smil og grin i lÃ¸bet af arbejdsdagen. âVi gÃ¸r tingene som en familie, og alle hjÃ¦lper til. Det giver sÃ¥dan en dejlig stemning, nÃ¥r man maler som i dag, og at se Lucas male med os, smelter bare mit hjerteâ, siger Sofie, der fortsÃ¦tter: âNÃ¥r vi arbejder sammen, flyver dagen bare afsted, og der er den stÃ¸rste fÃ¸lelse af tilfredshed, nÃ¥r vi kan smide os i sofaen i aften og se en god film.â'),
