(2274, 236, 'second_section_section_content', 'Familien Nyder at gÃ¥ til makronerne, og projektet lÃ¸ber hurtigere end forventet, sÃ¥ der er tid til en god stor frokost. âJa der skal noget i tankenâ, griner Anders med munden fuld af Ã¦ggemadder. Der gÃ¥r ikke lÃ¦nge fÃ¸r vÃ¦relset er malet fÃ¦rdigt, dog skal det lige have en tur mere i morgen. âjamen jeg vil flytte ind nuâ siger Lucas utÃ¥lmodigt, selvom han meget snart kan flytte ind i sit nye vÃ¦relse. âDagen gÃ¥r bare sÃ¥ meget bedre, nÃ¥r man hygger sig med opgaven, vi leger lege med penslerne, laver konkurrencer for at skabe noget dynamik i opgaven. Det gÃ¸r bare, at man glÃ¦der sig til at skulle male, i stedet for at det skal vÃ¦re en byrde. Og det hele er fordi, familien gÃ¸r det sammenâ, udtaler Anders.'),
